evidence.value:
${this.socialConfig.customSelectors.messageStretchingElements} {
  width: auto;
}
${this.socialConfig.customSelectors.messageRoot} {
  align-items: flex-start;
}
${this.socialConfig.customSelectors.messageContent} {
  position: relative;
}
${this.socialConfig.customSelectors.messageContent}:has(div) {
  min-height: 60px;
}

.poper-blocker-overlay {
  position: absolute;
  top: 0;
  left: 0;
  z-index: 1;
  width: 100%;
  height: 100%;
  min-width: min-content;
  white-space: nowrap;
  word-break: keep-all;
  background-color: #F5F9FF;
  border: 1px dashed #D1D9E0;
  font-size: 14px;
  font-weight: 700;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border-radius: 8px;
  padding: 16px;
}

.poper-blocker-overlay-container {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 5px;
}

.poper-blocker-overlay-icon {
  width: 16px;
  height: 16px;
  margin: 0;
  padding: 0;
}

.poper-blocker-overlay-label {
  color: #627280;
}

.poper-blocker-overlay-button {
  color: #5B96EE;
  cursor: pointer;
}
